import base64
import uuid

image = open("Intel_Core_i7_2020_logo.svg.png", "rb")
imageRead = base64.b64encode(image.read())
print(imageRead.decode("utf-8"))
image.close()
filename = uuid.uuid4()
file = open(filename.__str__()+".png", "wb")
message = (b'')
print(message)
file.write(base64.b64decode(message))

file.close()